import React, { Component } from 'react';

let msgArr = [];

class Messages extends Component {

    constructor(props){
        super(props);
        this.state = {msgArr: msgArr};
    }

    createTable = () => {
        let html = null;
        for (let i = 0; i < this.state.msgArr.length; i++) {
            html += <p>{this.state.msgArr[i]}</p>;
        }
        return html;
    };

    render() {
        return (<table>{this.createTable()}</table>);
    }

}

export default Messages;
export {msgArr};
